import React from 'react';
import axios from 'axios';
const KeyContext = () => {
    axios.get(`${process.env.REACT_APP_API_HOST_URL}/api/auth/token`)
      .then((response) => {
        return response.data;
      })
      .catch((error) => {
        console.error(error.message);
      });
}

export default KeyContext;
